/* #region Precios */
.prices-header {
    margin-bottom: 2rem;
}
.price-list {
  list-style-type: none;
  padding: 0;
  margin: 0;
}
.price-list li {
  display: inline-block; /* Mostrar elementos en línea */
  margin-right: 10px; /* Ajustar el espacio entre los botones según tu preferencia */
}
.price-button {
  padding: 10px 15px;
  font-size: 16px;
  background-color: #ECEBE9;
  color: #000;
  border: 1px solid #00C492;
  border-radius: 5px;
  cursor: pointer;
}

.price-button.active {
    background-color: #00C492;
    color: #fff;
}

.price-button:hover {
  text-decoration: none;
}
.price-hidden {
    display: none
}
.price-show {
    animation: priceShow .6s forwards
}
.price-hide {
    animation: priceFade .6s forwards
}
@keyframes priceFade {
    0% {
        opacity: 1;
        transform: translateY(0)
    }
    100% {
        opacity: 0;
        transform: translateY(80%)
    }
}
@keyframes priceShow {
    0% {
        opacity: 0;
        transform: translateY(-80%)
    }
    100% {
        opacity: 1;
        transform: translateY(0)
    }
}

